def determine_not(text):
    """ Deploys a N-gram based approach to handle negation """

    # Version 0.0.6 changes: This new function is added -  Negation handling error reduced from 18% to 3% for test data
    sentences = sent_tokenize(text)
    for i in range(len(sentences)):
        if ' not ' in sentences[i]:
            ncount = sentences[i].count('not')
            for count in range(ncount):
                not_location = sentences[i].find(' not ') + 4
                for j in sentences[i][not_location:].split():
                    k = re.sub(r'[^\w\s]', '', j)
                    if k in df_dict:
                        opposite = {"Happy": "sad", "Angry": "pleased",
                                    "Surprise": "expected", "Sad": "happy", "Fear": "calm"}
                        sentences[i] = re.sub(
                            rf' not (.*){k}', ' '+opposite[df_dict[k]], sentences[i])
                        break

    text = " ".join(sentences)

    return text


def removing_contradictions(text):
    """Function replaces all the negation words with 'not'"""

    if text.count("n't"):
        text = text.replace("n't", " not")
    text = re.sub("ai\snot", "am not", text)
    text = re.sub("wo\snot", "will not", text)
    return text


