def cleaning(text, emoji_weight, multi_mode):
    """Data pre-processing function that takes text as input and cleans it for the algorithm"""

    text = text.lower()
    text = re.sub(r'http\S+|www.\S+|#\S+', '', text)
    text = emojis_extractor(text, emoji_weight)
    text = removing_contradictions(text)
    if multi_mode:
        text = substituting_multiword(text)
    text = removing_not(text)

    text = text.split()
    text = removing_shortcuts(text)
    if "not" in text.split():
        text = determine_not(text)
    text = re.sub(r"[^a-zA-Z\'!]+", ' ', text)
    text = word_tokenize(text)
    words_big = removing_stopwords(text)
    clean_text = lemmatization(words_big)
    clean_text = re.sub('\s+', ' ', clean_text)
    return clean_text


def get_emotion(input, word_weights=[1, 1, 1, 1, 1], emoji_weight=1, multi_mode=1):
    """ Functions returns the emotions attached with the input text string """

    text = cleaning(input, int(emoji_weight), multi_mode).split()
    emotion_values = []
    emotions = {"Happy": 0, "Angry": 0, "Surprise": 0, "Sad": 0, "Fear": 0}
    y = 0
    try:
        for i in text:
            try:
                emotions[df_dict[i]] += 1
            except:
                pass
        if len(word_weights) != 5 or type(word_weights) != list:
            raise Exception("word_weights should be a list of length 5")
        else:
            emotions['Happy'] *= word_weights[0]
            emotions['Angry'] *= word_weights[1]
            emotions['Surprise'] *= word_weights[2]
            emotions['Sad'] *= word_weights[3]
            emotions['Fear'] *= word_weights[4]
        if sum(emotions.values()) == 0:
            return emotions
        for i in emotions:
            emotion_values.append(
                round((emotions[i] / sum(emotions.values())), 2))
        for j in emotions:
            emotions[j] = emotion_values[y]
            y += 1
        return emotions
    except:
        pass
